import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { NgcCookieConsentModule } from 'ngx-cookieconsent';
import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';
import { CommonModule } from '@angular/common';
import { FormlyModule } from '@ngx-formly/core';
import { FormlyBootstrapModule } from '@ngx-formly/bootstrap';
import { FormlyFieldConfig } from '@ngx-formly/core';
import { FormGroup } from '@angular/forms';
import { ActivatedRoute, ParamMap, Router } from '@angular/router';


@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent implements OnInit {
  readonly ROOT_URL = 'http://localhost:5069';

  constructor(private http: HttpClient, @Inject('BASE_URL') public baseUrl: string, private route: ActivatedRoute, private router: Router) {
    this.route.paramMap.subscribe(params => {
      this.id = params.get('id');
    });
    this.router.routeReuseStrategy.shouldReuseRoute = () => false;
    http.get<SectionFields[]>(baseUrl + 'SectionField?id=' + this.id).subscribe(result => {
      this.fields2 = result;
      this.fields = this.fields2;
    }, error => console.error(error));
  }

  ngOnInit() {
    let cc = window as any;
    cc.cookieconsent.initialise({
      palette: {
        popup: {
          background: "#164969"
        },
        button: {
          background: "#ffe000",
          text: "#164969"
        }
      },
      theme: "classic",
      content: {
        message: "www",
        dismiss: "www",
        link: "www",
        href: "www"
      }
    });
  }

  getfields() {
    return this.http.get(this.ROOT_URL + '/Sections');
  }
}
